import React, { useEffect, useState } from 'react'
import AdminNav from '../AdminNavbar/AdminNav'
import DataTable from 'react-data-table-component';


function OwnerContacts() {

    const data = [
        { id: 1, name: 'John Doe', age: 30, country: 'USA' },
        { id: 2, name: 'Jane Smith', age: 25, country: 'Canada' },
        { id: 3, name: 'Mike Johnson', age: 35, country: 'UK' },
        { id: 4, name: 'kim Doe', age: 30, country: 'USA' },
        { id: 5, name: 'max Smith', age: 25, country: 'Canada' },
        { id: 3, name: 'hoi Johnson', age: 35, country: 'UK' },
        { id: 1, name: 'hi Doe', age: 30, country: 'USA' },
        { id: 2, name: 'roy Smith', age: 25, country: 'Canada' },
        { id: 3, name: 'ram Johnson', age: 35, country: 'UK' },
        { id: 1, name: 'samm Doe', age: 30, country: 'USA' },
        { id: 2, name: 'emmanuel Smith', age: 25, country: 'Canada' },
        { id: 3, name: 'elsa Johnson', age: 35, country: 'UK' },
        { id: 1, name: 'jacob Doe', age: 30, country: 'USA' },
        { id: 2, name: 'lily Smith', age: 25, country: 'Canada' }
       
    ];

    const [records, setRecords] = useState(data);
    const [searchQuery, setSearchQuery] = useState('');
    const [searchResults, setSearchResults] = useState([]);

    const columns = [
        {
            name: 'Name',
            selector:  row=>row.name,
            sortable: true
        },
        {
            name: 'Age',
            selector:  row=>row.age,
            sortable: true
        },
        {
            name: 'Country',
            selector:  row=> row.country,
            sortable: true
        }
    ];
    
    // const handleSearch = (e) => {
    //     const query = e.target.value;
    //     setSearchQuery(query);
    
    //     const filteredData = records.filter(item =>
    //       item.name.toLowerCase().includes(query.toLowerCase())
    //     );
    //         setSearchResults(filteredData);
    //   };


    useEffect(() => {
        const filteredData = records.filter(item =>
            item.name.toLowerCase().includes(searchQuery.toLowerCase())
        );
        setSearchResults(filteredData);
    }, [searchQuery, records]);

    const handleSearch = (e) => {
        const query = e.target.value;
        setSearchQuery(query);
    };




  return (
    <div>
        <AdminNav/>
        <div className="container mt-5">

        <input
        
        className='form-control'
                type="search"
                placeholder="Search..."
                value={searchQuery}
                onChange={handleSearch}
                aria-label="Search"
            />

        <DataTable
            title="Owner Contact Details"
            columns={columns}
            keyField="id"
            data={searchResults}
            fixedHeader
            pagination

        />
        </div>
    </div>
  )
}

export default OwnerContacts
